private void privateSetTree(T rootData, BinaryTree<T> leftTree,                                        BinaryTree<T> rightTree){   root = new BinaryNode<T>(rootData);   if ((leftTree != null) && !leftTree.isEmpty())      root.setLeftChild(leftTree.root.copy());       if ((rightTree != null) && !rightTree.isEmpty())      root.setRightChild(rightTree.root.copy());} // end privateSetTree